import { Link } from "react-router-dom";
import "./styles.css";
import Header from "../../Components/Header";
import { Div, P } from "./style";
function Display() {
  return (
    <>
      <Header />
      <Div className="display">
        <div className="background"></div>
        <P>Cadastre novos produtos </P>
      </Div>
    </>
  );
}

export default Display;
